import React from "react";

interface State{
    email: string;
    password: string;
    firstName: string;
    lastName: string;
}

export function Registry(): JSX.Element {
    const [registryInfo, setRegistryInfo] = useState<State>({
        email: "",
        password: "",
        lastName: "",
        firstName: ""
    });
  async function handleSubmit(
    event: React.FormEvent<HTMLFormElement>
  ): Promise<void> {
    event.preventDefault();
  }

  function handleChange(event: React.ChangeEvent<HTMLInputElement>): void{
    const value = event.target.value;
    setRegistryInfo({
        ...registryInfo,
        [event.target.name]: value
    }
    );
}

  return (
    <>
      <form onSubmit={handleSubmit}>
        <label>
          Name:
          <input type="text" value={registryInfo.firstName} name="firstName" onChange={handleChange} />
        </label>
        <br />
        <label>
          LastName:
          <input type="text" value={registryInfo.lastName} name="lastName" onChange={handleChange} />
        </label>
        <br />
        <label>
          Email:
          <input type="text" value={registryInfo.email} name="email" onChange={handleChange} />
        </label>
        <br />
        <label>
          Password:
          <input type="password" value={registryInfo.password} name="password" onChange={handleChange}/>
        </label>
        <br />
        <input type="submit" value="Register" />
      </form>
      <a href="/">
        <button type="button">Go back</button>
      </a>
    </>
  );
}
